import React from "react";

const styles = {
  right: {
    backgroundColor: "white",
    height: "100vh",
    width: "50%",
    position: "fixed",
    top: 0,
    right: 0,
  },
  container: {
    width: "100%",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },

  box: {
    border: "1px solid black",
    marginTop: "30px",
    minWidth: "80%",
    minHeight: "40vh",
  },
};

function Works() {
  return (
    <div style={styles.right}>
      <div style={styles.container}>
        <div style={styles.box}></div>
        <div style={styles.box}></div>
        <div style={styles.box}></div>
        <div style={styles.box}></div>
        <div style={styles.box}></div>
        <div style={styles.box}></div>
      </div>
    </div>
  );
}

export default Works;
